        public MainViewModel(Admin admin = null)
        {
            // Initialize dashboard, utility, admin
            dashboard = new DashBoard();
            _utility = new Utility();
            _admin = new Admin();
            _admin = admin;
            dashboard.IsDgNonTrapParametersVisible = false;
            dashboard.UserName = _admin.UserName;
            dashboard.Password = _admin.Password;
            subSystemCollection = new Dictionary<string, SubSystem>();
            subSystemNonTrapCollection = new Dictionary<string, string>();
            subSystemTrapCollection = new Dictionary<string, string>();
            subSystemCollection = getSubSystemDetails(out subSystemNonTrapCollection, out subSystemTrapCollection);


            subSystemCollection = new Dictionary<string, SubSystem>();
            subSystemNonTrapCollection = new Dictionary<string, string>();
            subSystemTrapCollection = new Dictionary<string, string>();
            subSystemCollection = getSubSystemDetails(out subSystemNonTrapCollection, out subSystemTrapCollection);

           

            // Load other subsystems, dashboard, etc.
            try
            {
                // Load SharpPcap devices
                _liveDevices = CaptureDeviceList.Instance;

                // Populate NICs and DeviceCollection
                GetDeviceDetails();

                // Start background monitoring for failover
                StartNetworkMonitor();

                dashboard.GreetingMessage = UpdateGreetingMessage();
                LoadMainDefault();
            }
            catch (Exception ex)
            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(MainViewModel));
            }
        }
        public Action<string> SetNetworkStatusHandler {  get; set; }
        private void GetDeviceDetails()
        {
            var networkInterfaces = NetworkInterface.GetAllNetworkInterfaces()
                .Where(nic => nic.NetworkInterfaceType == NetworkInterfaceType.Ethernet &&
                             // nic.OperationalStatus == OperationalStatus.Up &&
                              !nic.Description.ToLower().Contains("virtual") &&
                              !nic.Description.ToLower().Contains("loopback"))
                .ToList();

            //if (networkInterfaces.Count == 0)
            //{
            //    RsDialogBox.ShowMsg("Please check network connection", "Network Error", MessageBoxButton.OK, MessageBoxImage.Error);
            //    _admin.IsDevicePopupEnable = false;
            //    _admin.DeviceCollection = new ObservableCollection<DeviceInfo>();
            //    _admin.DeviceDescription = null;
            //    return;
            //}

            _admin.IsDevicePopupEnable = true;
            ObservableCollection<DeviceInfo> devices = new ObservableCollection<DeviceInfo>();

            for (int i = 0; i < _liveDevices.Count; i++)
            {
                if (networkInterfaces.Any(n => n.Description == _liveDevices[i].Description))
                {
                    devices.Add(new DeviceInfo(i, _liveDevices[i].Description));
                }
            }

            _admin.DeviceCollection = devices;

            if (devices.Count == 1)
            {
                devices[0].IsChecked = true;
                InitializeCaptureDevice(devices[0].DeviceDescription);
            }
            else
            {
                foreach (var device in devices)
                    device.IsChecked = false;
                _admin.DeviceDescription = null;
            }
        }

        private void InitializeCaptureDevice(string adapterDescription)
        {
            try
            {
                // Close previous device if any
                _captureDevice?.Close();

                // Find selected device
                _captureDevice = _liveDevices.FirstOrDefault(d =>
                    d.Description.Equals(adapterDescription, StringComparison.OrdinalIgnoreCase));

                if (_captureDevice == null) return;

                _captureDevice.OnPacketArrival += Device_OnPacketArrival;
                _captureDevice.Open();

                // Start capture on a separate thread
                Thread thCapture = new Thread(() =>
                {
                
                    try { _captureDevice.Capture(); }
                    catch (ArgumentOutOfRangeException ex) { LCPLogUtils.LogException(ex, GetType().Name, nameof(MainViewModel)); }                        
                    catch (Exception ex) { LCPLogUtils.LogException(ex, GetType().Name, nameof(InitializeCaptureDevice)); }
                
                });
                thCapture.Start();

                // Store active adapter ID
                var nic = NetworkInterface.GetAllNetworkInterfaces()
                            .FirstOrDefault(n => n.Description == adapterDescription);
                _activeAdapterId = nic?.Id;

                _admin.DeviceDescription = adapterDescription;
            }
            catch (Exception ex)
            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(InitializeCaptureDevice));
            }
        }



