        private void NetworkChange_NetworkAddressChanged(object sender, EventArgs e)
        {
            var adapters = NetworkInterface.GetAllNetworkInterfaces()
                .Where(n => n.NetworkInterfaceType == NetworkInterfaceType.Ethernet &&
                            n.OperationalStatus == OperationalStatus.Up &&
                            !n.Description.ToLower().Contains("virtual") &&
                            !n.Description.ToLower().Contains("loopback")).ToList();


            if (adapters.Count == 0)
            {
                //RsDialogBox.ShowMsg("No network available", "Network", MessageBoxButton.OK, MessageBoxImage.Error);
                SetNetworkStatusHandler("No network connection detected. Please check your Network Connection");
               
                Application.Current.Dispatcher.Invoke(() =>
                {
                    RsDialogBox.ShowMsg($"Network Connection Loss : {_admin.DeviceDescription}",
                                        "Network",
                                        MessageBoxButton.OK,
                                        MessageBoxImage.Error);
                });

                return;
            }
           // RsDialogBox.ShowMsg("Network available", "Network", MessageBoxButton.OK, MessageBoxImage.Error);
            SetNetworkStatusHandler("Network Connected");
            if(_admin.DeviceDescription!= adapters[0].Description)
            {

                Application.Current.Dispatcher.Invoke(() =>
                {
                    RsDialogBox.ShowMsg($"Network Connection Loss : {_admin.DeviceDescription}  \n  Network Connected : {adapters[0].Description}" ,
                                        "Network",
                                        MessageBoxButton.OK,
                                        MessageBoxImage.Error);
                });

            }
            else
            {
                Application.Current.Dispatcher.Invoke(() =>
                {
                    RsDialogBox.ShowMsg($"Network Connected : {adapters[0].Description}",
                                        "Network",
                                        MessageBoxButton.OK,
                                        MessageBoxImage.Error);
                });
            }
                InitializeCaptureDevice(adapters[0].Description);
           

            //// If only one adapter available, automatically use it
            //if (adapters.Count == 1 && _activeAdapterId != adapters[0].Id)
            //{
            //    Application.Current.Dispatcher.Invoke(() =>
            //    {

            //    });
            //    return;
            //}

            //ShowNetworkSelectionPopup(adapters);
        }

        private void CheckNetworkAdapters(object state)
        {
            var adapters = NetworkInterface.GetAllNetworkInterfaces()
                .Where(n => n.NetworkInterfaceType == NetworkInterfaceType.Ethernet &&
                            n.OperationalStatus == OperationalStatus.Up &&
                            !n.Description.ToLower().Contains("virtual") &&
                            !n.Description.ToLower().Contains("loopback"))
                .ToList();

            if (adapters.Count == 0)
            {
                RsDialogBox.ShowMsg("No network available", "Network", MessageBoxButton.OK, MessageBoxImage.Error);

                return;
            }

            // If only one adapter available, automatically use it
            if (adapters.Count == 1 && _activeAdapterId != adapters[0].Id)
            {
                Application.Current.Dispatcher.Invoke(() =>
                {
                    InitializeCaptureDevice(adapters[0].Description);
                });
                return;
            }

            // Multiple adapters → if selected adapter is down, prompt user
            if (_activeAdapterId != null && !adapters.Any(a => a.Id == _activeAdapterId))
            {
                Application.Current.Dispatcher.Invoke(() =>
                {
                    ShowNetworkSelectionPopup(adapters);
                });
            }
        }

        private void ShowNetworkSelectionPopup(List<NetworkInterface> availableAdapters)
        {
            NetworkInterface[] networkInterfaces = NetworkInterface.GetAllNetworkInterfaces();
            Dictionary<string, string> networkCollection = new Dictionary<string, string>();
            ObservableCollection<DeviceInfo> devices = new ObservableCollection<DeviceInfo>();

            try
            {
                foreach (NetworkInterface item in networkInterfaces)
                {
                    if (item.NetworkInterfaceType == NetworkInterfaceType.Ethernet &&
                        !item.Description.ToLower().Contains("virtual") &&
                        !item.Description.ToLower().Contains("loopback"))
                    {
                        // ✅ Only consider NICs that are UP
                        if (item.OperationalStatus == OperationalStatus.Up)
                        {
                            string networkDescription = item.Description;
                            string name = item.Name;

                            // Handle duplicate NIC descriptions
                            if (networkCollection.ContainsKey(networkDescription))
                            {
                                int count = 1;
                                string newKey = networkDescription + "_" + count;
                                while (networkCollection.ContainsKey(newKey))
                                {
                                    count++;
                                    newKey = networkDescription + "_" + count;
                                }
                                networkDescription = newKey;
                            }

                            networkCollection.Add(networkDescription, name);
                        }
                    }
                }

              

                for (int i = 0; i < _liveDevices.Count; i++)
                {
                    if (networkCollection.ContainsKey(_liveDevices[i].Description))
                    {
                        int index = i;
                        string description = _liveDevices[i].Description;
                        devices.Add(new DeviceInfo(index, description));
                    }
                }
                // _activeAdapterId = devices[0].Driverindex;
                InitializeCaptureDevice(devices[0].DeviceDescription);

              
            }
            catch 
            {
            
            }
       }



