        #region All Button Actions
        public void UserLogout(object param)
        {
            try
            {
                if(param!=null)
                {
                    int tagValue = (int)param;
                    MainWindow main1 = new MainWindow();
                    var main = Application.Current.Windows.OfType<Main>().ToList();
                    foreach (var window in main)
                    {
                        window.Close();
                    }

                    if (tagValue > 0)
                        _utility.ExerciseEndDataSave(tagValue, DateTime.Now);

                    main1.ShowDialog();
                }
            }
            catch (Exception ex)
            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(UserLogout));
            }
        }
