        private void FaultReportView(object Parameter)
        {
            try
            {
                if (Parameter is string tagValue)
                {
                    dashboard.IsLeftSliderShow = false;
                    dashboard.IsReport = true;
                    dashboard.IsLeftSliderShow = false;
                    dashboard.IsDashbordScreenEnable = false;
