        private void RightNavigation()
        {
            try
            {
                var mainWindows = Application.Current.Windows.OfType<Main>().ToList();

                if (mainWindows[0].Dg1Panel.Visibility == Visibility.Visible)
                {
                    navIncrementIndex = 0;
                }
                else if (mainWindows[0].Radio1Panel.Visibility == Visibility.Visible)
                {
                    navIncrementIndex = 2;
                }
                else if (mainWindows[0].UPS1Panel.Visibility == Visibility.Visible)
                {
                    navIncrementIndex = 1;
                }
                else if (mainWindows[0].Switch1Panel.Visibility == Visibility.Visible)
                {
                    navIncrementIndex = 3;
                }
                navIncrementIndex += 1;
                int getIndex = (int)navIncrementIndex;
                if (getIndex != 4)
                {
                    if (getIndex == 1)
                    {
                        dashboard.IsSubsystemsPanelOne = false;
                        dashboard.IsSubsystemsPanelTwo = true;
                        mainWindows[0].Dg1Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].DG2Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].Radio1Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].Radio2Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].Switch1Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].Switch2Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].UPS1Panel.Visibility = Visibility.Visible;
                        mainWindows[0].UPS2Panel.Visibility = Visibility.Visible;
                    }
                    else if (getIndex == 2)
                    {
                        dashboard.IsSubsystemsPanelOne = false;
                        dashboard.IsSubsystemsPanelTwo = false;
                        dashboard.IsSubsystemsPanelThree = true;

                        mainWindows[0].Dg1Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].DG2Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].Radio1Panel.Visibility = Visibility.Visible;
                        mainWindows[0].Radio2Panel.Visibility = Visibility.Visible;
                        mainWindows[0].Switch1Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].Switch2Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].UPS1Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].UPS2Panel.Visibility = Visibility.Collapsed;
                    }
                    else if (getIndex == 3)
                    {
                        dashboard.IsSubsystemsPanelOne = false;
                        dashboard.IsSubsystemsPanelTwo = false;
                        dashboard.IsSubsystemsPanelThree = false;
                        dashboard.IsSubsystemsPanelFour = true;

                        mainWindows[0].Dg1Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].DG2Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].Radio1Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].Radio2Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].Switch1Panel.Visibility = Visibility.Visible;
                        mainWindows[0].Switch2Panel.Visibility = Visibility.Visible;
                        mainWindows[0].UPS1Panel.Visibility = Visibility.Collapsed;
                        mainWindows[0].UPS2Panel.Visibility = Visibility.Collapsed;
                    }
                }
                else
                {
                    navIncrementIndex = 2;
                    RsDialogBox.ShowMsg("No more screens are available!", "Screen Information", MessageBoxButton.OK, MessageBoxImage.Warning);
                }
            }
            catch (Exception ex)
            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(RightNavigation));
            }
        }
        private void LeftNavigation()
        {
            try
            {
                var mainWindows = Application.Current.Windows.OfType<Main>().ToList();
                if (mainWindows[0].Dg1Panel.Visibility == Visibility.Visible)
                {
                    navIncrementIndex = 0;
                }
                else if (mainWindows[0].Radio1Panel.Visibility == Visibility.Visible)
                {
                    navIncrementIndex = 2;
                }
                else if (mainWindows[0].UPS1Panel.Visibility == Visibility.Visible)
                {
                    navIncrementIndex = 1;
                }
                else if (mainWindows[0].Switch1Panel.Visibility == Visibility.Visible)
                {
                    navIncrementIndex = 3;
