        private Dictionary<string, SubSystem> getSubSystemDetails(out Dictionary<string, string> sourceSnmpPortMap, out Dictionary<string, string> sourceSnmpTrapMap)
        {
            Dictionary<string, SubSystem> subSyetemCollection = new Dictionary<string, SubSystem>();
            sourceSnmpPortMap = new Dictionary<string, string>();
            sourceSnmpTrapMap = new Dictionary<string, string>();

            try
            {
                foreach (var a in SubsytemInfo.AllSubSystemInfo.Values)
                {
                    subSyetemCollection.Add(a.Source_Ip, new SubSystem(a.Source_Ip, a.Destination_Ip, a.port, a.portTrap, a.SubsystemFile, 1));
                    sourceSnmpPortMap.Add(a.Source_Ip, a.port.ToString());
                    sourceSnmpTrapMap.Add(a.Source_Ip, a.portTrap.ToString());
                }
                return subSyetemCollection;
            }
            catch (Exception ex)
            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(getSubSystemDetails));
            }
            return null;
        }
