        private bool PingHost(string ip)
        {
            try
            {
                using (Ping ping = new Ping())
                {
                    PingReply reply = ping.Send(ip, 4000); // 1 second timeout
                    return reply.Status == IPStatus.Success;
                }
            }
            catch(Exception ex)
            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(PingHost));
                return false;
            }
        }               
        private string UpdateGreetingMessage()
        {
            string greetingMessage = string.Empty;
            try
            {
                DateTime currentTime = DateTime.Now;

                if (currentTime.Hour >= 5 && currentTime.Hour < 12)
                {
                    greetingMessage = "Good Morning .. !";
                }
                else if (currentTime.Hour >= 12 && currentTime.Hour < 17)
                {
                    greetingMessage = "Good Afternoon .. !";
                }
                else if (currentTime.Hour >= 17 && currentTime.Hour < 20)
                {
                    greetingMessage = "Good Evening .. !";
                }
                return greetingMessage;
            }
            catch (ArgumentOutOfRangeException ex)
            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(UpdateGreetingMessage));
            }
            catch (Exception ex)
            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(UpdateGreetingMessage));
            }
            return null;
        }
