                        decimal parameterValue = Convert.ToDecimal(mainsFreq_Hz.ParameterValue) / DashboardCommonData.SmallChangeindecimal;

                        dashboard.MainsFreq_Hz2 = parameterValue.ToString("F1") + DashboardCommonData.SmallHz;
                        dashboard.MainsFreqTimestamp2 = mainsFreq_Hz.TimeStamp;
                        decimal IsmainsFreq_Hz = Convert.ToDecimal(mainsFreq_Hz.ParameterValue);
                        decimal IsmainsFreqHzRed = Convert.ToDecimal(mainsFreq_Hz.Redcolor);
                        decimal IsmainsFreqHzAmber = Convert.ToDecimal(mainsFreq_Hz.Ambercolor);

