            Dictionary<string, ParameterSetConfig> radioMap;
            radioMap = new Dictionary<string, ParameterSetConfig>();
            radioMap = radioCollection;
            if (radioMap.Count == 0) return;
            string Deviceaddress = string.Empty;
            string extractedOid = string.Empty;
            var oidParts = radioMap.Keys.FirstOrDefault();
            int rqOID1 = oidParts.Length;
            var Oid = oidParts.ToString().Split('.');
            int oidlengthMAX = 17;
            try
            {
                try
                {
                    if (Oid.Length < oidlengthMAX)
                    {
                        extractedOid = oidParts;
                    }
                    else
                    {
                        if (Oid.Length > oidlengthMAX)
                        {
                            extractedOid = oidParts.Substring(0, Common.txpwrslot7.Length);
                            string a = Oid.Last();
                            extractedOid = extractedOid + "." + a;
                        }
                        else
                        {
