        private void LoadTrap(ObservableCollection<TrapInfo> collect, IsSubSystem isSubSystem)
        {
            try
            {

                ObservableCollection<TrapInfo> ResultCollection = new ObservableCollection<TrapInfo>();
                int isSystemIndex = (int)isSubSystem;
                if (collect != null)
                {
                    switch (isSystemIndex)
                    {
                        case 1:
                            var dgResult = collect.Where(x => x.SysName == _utility.GetSubsystemName(IsSubSystem.DieselGenerator));
                            if (dgResult.Any())
                            {
                                SystemSounds.Beep.Play();

                                var DgreversedList = dgResult.Cast<TrapInfo>().Reverse().ToList();
                                DgreversedList.First().IsLatest = true;

                                CollectionView DgllectionView = (CollectionView)CollectionViewSource.GetDefaultView(DgreversedList);
                                PropertyGroupDescription Dg = new PropertyGroupDescription("TrapType");
                                DgllectionView.GroupDescriptions.Add(Dg);
                                dashboard.DgTrapCollection = DgllectionView;
                            }
                            break;
                        case 2:
                            var upsResult = collect.Where(x => x.SysName == _utility.GetSubsystemName(IsSubSystem.UPS));

                            if (upsResult.Any())
                            {
                                SystemSounds.Beep.Play();
                                var UpsreversedList = upsResult.Cast<TrapInfo>().Reverse().ToList();
                                UpsreversedList.First().IsLatest = true;
                                CollectionView UPScollectionView = (CollectionView)CollectionViewSource.GetDefaultView(UpsreversedList);
