            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(LoadTrap));
            }
        }
        #endregion

        #region PacketRecieve
        private void Device_OnPacketArrival(object sender, PacketCapture e)
        {
            RawCapture rawPacket;
            try
            {
                rawPacket = e.GetPacket();
                Packet packet = Packet.ParsePacket(rawPacket.LinkLayerType, rawPacket.Data);

                if (packet is EthernetPacket ethernet)
                {
                    IPPacket ip = packet.Extract<IPPacket>();
                    if (ip != null)
                    {
                        UdpPacket udp = packet.Extract<UdpPacket>();
                        if (udp != null)
                        {
                            dashboard.Currentdatetime = DateTime.Now.ToString();
                            dashboard.GreetingMessage = this.UpdateGreetingMessage();

                            string subSysSourceAddress = ip.SourceAddress.ToString();
                            string rxDestinationAddress = ip.DestinationAddress.ToString();

                            if (!subSystemCollection.ContainsKey(subSysSourceAddress))
                            {
                                return;
                            }
                            SubSystem subSystem = subSystemCollection[subSysSourceAddress];

                            byte[] byteData = udp.PayloadData;
                            if (subSystemNonTrapCollection.ContainsKey(subSysSourceAddress))
                            {
                                string snmpPort = subSystemNonTrapCollection[subSysSourceAddress];
                                string snmpTrap = subSystemTrapCollection[subSysSourceAddress];

                                if ((udp.DestinationPort.ToString().CompareTo(snmpTrap) == 0) || (udp.SourcePort.ToString().CompareTo(snmpPort) == 0))
                                {
                                    string subSystemFileName = subSystem.Filename;
                                    if (subSystemFileName.CompareTo(ConfigDGPath) == 0)
                                    {
                                        if (udp.SourcePort.ToString().CompareTo(snmpPort) == 0)
                                        {
                                            dgCollection = new Dictionary<string, ParameterSetConfig>();

                                            dgCollection = _utility.getLoadSnmplastLivedata(byteData, subSysSourceAddress, IsSubSystem.DieselGenerator);

                                            Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                            {
                                                LoadSnmpDgData(dgCollection, subSysSourceAddress);
                                            });
                                        }
                                        if (udp.SourcePort.ToString().CompareTo(snmpPort) != 0)
                                        {
                                            if (SubsytemInfo.AllSubSystemInfoDictionary[UsageConstants.DieselGeneratorText] == subSysSourceAddress)
                                            {
                                                ObservableCollection<TrapInfo> DgTrapCollection1 = _utility.LoadSnmpTrap(byteData, subSysSourceAddress, IsSubSystem.DieselGenerator, "1.3.6.1.4.1.41385");

                                                Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                                {
                                                    LoadTrap(DgTrapCollection1, IsSubSystem.DieselGenerator);
                                                });
                                            }
                                            else if (SubsytemInfo.AllSubSystemInfoDictionary[UsageConstants.DieselGenerator2Text] == subSysSourceAddress)
                                            {
                                                ObservableCollection<TrapInfo> DgTrapCollection2 = _utility.LoadSnmpTrap(byteData, subSysSourceAddress, IsSubSystem.DieselGenerator2, "1.3.6.1.4.1.41385");

                                                Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                                {
                                                    LoadTrap(DgTrapCollection2, IsSubSystem.DieselGenerator2);
                                                });
                                            }

                                        }
                                    }
                                    if (subSystemFileName.CompareTo("ConfigRouterset.txt") == 0)
                                    {
                                        if (udp.SourcePort.ToString().CompareTo(snmpPort) == 0)
                                        {
                                            routerCollection = new Dictionary<string, ParameterSetConfig>();

                                            routerCollection = _utility.getLoadSnmplastLivedata(byteData, subSysSourceAddress, IsSubSystem.Router);
                                            Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                            {
                                                LoadSnmpRouterData(routerCollection, subSysSourceAddress);
                                            });
                                        }
                                        if (udp.SourcePort.ToString().CompareTo(snmpPort) != 0)
                                        {
                                            ObservableCollection<TrapInfo> DgTrapCollection = _utility.LoadSnmpTrap(byteData, subSysSourceAddress, IsSubSystem.Router, "1.3.6.1.6.3");

                                            Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                            {
                                                LoadTrap(DgTrapCollection, IsSubSystem.Router);
                                            });
                                        }
                                    }
                                    if (subSystemFileName.CompareTo(ConfigRadioPath) == 0)
                                    {
                                        if (udp.SourcePort.ToString().CompareTo(snmpPort) == 0)
                                        {
                                            radioCollection = new Dictionary<string, ParameterSetConfig>();

                                            radioCollection = _utility.getLoadSnmplastLivedata(byteData, subSysSourceAddress, IsSubSystem.Radio);
                                            Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                            {
                                                LoadSnmpRadioData(radioCollection, subSysSourceAddress);
                                            });
                                        }
                                        if (udp.SourcePort.ToString().CompareTo(snmpPort) != 0)
                                        {

                                            if (SubsytemInfo.AllSubSystemInfoDictionary[UsageConstants.RadioText] == subSysSourceAddress)
                                            {
                                                ObservableCollection<TrapInfo> RadioTrapCollection = _utility.LoadSnmpTrap(byteData, subSysSourceAddress, IsSubSystem.Radio, "1.3.6.1.4.1.21025");

                                                Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                                {
                                                    LoadTrap(RadioTrapCollection, IsSubSystem.Radio);
                                                });
                                            }
                                            else if (SubsytemInfo.AllSubSystemInfoDictionary[UsageConstants.Radio2Text] == subSysSourceAddress)
                                            {
                                                ObservableCollection<TrapInfo> DgTrapCollection = _utility.LoadSnmpTrap(byteData, subSysSourceAddress, IsSubSystem.Radio2, "1.3.6.1.4.1.21025");

                                                Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                                {
                                                    LoadTrap(DgTrapCollection, IsSubSystem.Radio2);
                                                });
                                            }
                                        }
                                    }
                                    if (subSystemFileName.CompareTo(ConfigSwitchPath) == 0)
                                    {
                                        if (udp.SourcePort.ToString().CompareTo(snmpPort) == 0)
                                        {
                                            switchCollection = new Dictionary<string, ParameterSetConfig>();

                                            switchCollection = _utility.getLoadSnmplastLivedata(byteData, subSysSourceAddress, IsSubSystem.Switch);
                                            Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                            {
                                                LoadSnmpSwitchData(switchCollection, subSysSourceAddress);
                                            });
                                        }
                                        else
                                        {

                                            if (SubsytemInfo.AllSubSystemInfoDictionary[UsageConstants.SwitchText] == subSysSourceAddress)
                                            {
                                                ObservableCollection<TrapInfo> SwitchTrapCollection1 = _utility.LoadSnmpTrap(byteData, subSysSourceAddress, IsSubSystem.Switch, "1.3.6.1.6.3");

                                                Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                                {
                                                    LoadTrap(SwitchTrapCollection1, IsSubSystem.Switch);
                                                });
                                            }
                                            else if (SubsytemInfo.AllSubSystemInfoDictionary[UsageConstants.Switch2Text] == subSysSourceAddress)
                                            {
                                                ObservableCollection<TrapInfo> SwitchTrapCollection2 = _utility.LoadSnmpTrap(byteData, subSysSourceAddress, IsSubSystem.Switch2, "1.3.6.1.6.3");

                                                Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                                {
                                                    LoadTrap(SwitchTrapCollection2, IsSubSystem.Switch2);
                                                });
                                            }
                                        }
                                    }
                                    if (subSystemFileName.CompareTo("UPSNonTrapConfigset.txt") == 0)
                                    {
                                        if (udp.DestinationPort.ToString().CompareTo(snmpTrap) == 0)
                                        {

                                            if (SubsytemInfo.AllSubSystemInfoDictionary["UPS"] == subSysSourceAddress)
                                            {
                                                ObservableCollection<TrapInfo> TrapUPSCollection = _utility.LoadSnmpTrap(byteData, subSysSourceAddress, IsSubSystem.UPS, "1.3.6.1.2.1.33");
                                                Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                                {
                                                    LoadTrap(TrapUPSCollection, IsSubSystem.UPS);
                                                });
                                            }
                                            else if (SubsytemInfo.AllSubSystemInfoDictionary["UPS2"] == subSysSourceAddress)
                                            {
                                                ObservableCollection<TrapInfo> TrapUPSCollection2 = _utility.LoadSnmpTrap(byteData, subSysSourceAddress, IsSubSystem.UPS2, "1.3.6.1.2.1.33");
                                                Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                                {
                                                    LoadTrap(TrapUPSCollection2, IsSubSystem.UPS2);
                                                });
                                            }

                                        }
                                        else
                                        {
                                            upsCollection = new Dictionary<string, ParameterSetConfig>();

                                            upsCollection = _utility.getLoadSnmplastLivedata(byteData, subSysSourceAddress, IsSubSystem.UPS);

                                            Application.Current.Dispatcher.Invoke(DispatcherPriority.Normal, (Action)delegate
                                            {
                                                LoadSnmpUpsData(upsCollection, subSysSourceAddress);
                                            });
                                        }
                                    }
                                }
                            }


                        }
                    }
                }
            }
            catch (AccessViolationException ex)
            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(Device_OnPacketArrival));
            }
            catch (Exception ex)
            {
                LCPLogUtils.LogException(ex, GetType().Name, nameof(Device_OnPacketArrival));
            }
        }
        #endregion

    }
